import React, { useState } from 'react';
import { Button, Popover, PopoverHeader, PopoverBody } from 'reactstrap';
import './Navbar.css';

const Navbar = () => {
  const [expertisePopover, setExpertisePopover] = useState(false);
  const [solutionsPopover, setSolutionsPopover] = useState(false);

  const toggleExpertisePopover = () => setExpertisePopover(!expertisePopover);
  const toggleSolutionsPopover = () => setSolutionsPopover(!solutionsPopover);

  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <div className="container">
        <a className="navbar-brand" href="#">EsaLink</a>
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse justify-content-between" id="navbarNav">
          <ul className="navbar-nav">
            <li className="nav-item">
              <a className="nav-link" href="https://www.google.com" target="_blank">Tma Connection</a>
            </li>
          </ul>
          <div className="navbar-text">
            <Button color="primary" className="mr-3">Electronic Invoicing 2024</Button>
            <span className="expertise" id="expertise" onMouseEnter={toggleExpertisePopover} onMouseLeave={toggleExpertisePopover}>Expertise</span>
            <Popover placement="bottom" isOpen={expertisePopover} target="expertise" toggle={toggleExpertisePopover}>
              <PopoverHeader>Expertise</PopoverHeader>
              <PopoverBody>Popover content for Expertise</PopoverBody>
            </Popover>
            <span className="solutions" id="solutions" onMouseEnter={toggleSolutionsPopover} onMouseLeave={toggleSolutionsPopover}>Solutions</span>
            <Popover placement="bottom" isOpen={solutionsPopover} target="solutions" toggle={toggleSolutionsPopover}>
              <PopoverHeader>Solutions</PopoverHeader>
              <PopoverBody>Popover content for Solutions</PopoverBody>
            </Popover>
            <Button color="primary" className="ml-3">Get a Demo</Button>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
